(169, 169, 'G1A015037', '198701272012122001', 'Sistem Informasi Kehadiran Pegawai Menggunakan Kode QR', '', 'VI/2018-2019', 'Sistem Informasi Kehadiran Pegawai merupakan sistem informasi yang memudahkan dalam mendata kehadiran pegawai. Sistem ini mempunyai dua platform yaitu web(Laravel) dan Android. ', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
(170, 170, 'G1A015040', '198906232018031001', 'Sistem Informasi DMI Bengkulu', '', 'VI/2018-2019', 'Sistem Informasi profil Dewan Masjid Indonesia adalah sistem berbasis website yang digunakan oleh dewan masjid indonesia (DMI) Kota Bengkulu sebagai sarana publikasi dan penyimpanan data masjid dan mushola di Kota Bengkulu. Sistem dirancang untuk menampilkan profil organisasi DMI, informasi masjid dan mushola, serta kumpulan khutbah dan berita tentang DMI. informasi masjid berupa data terkait masjid dan peta lokasi menggunakan google maps. kumpulan khutbah dan berita dibuat sebagai sarana syiar DMI sehingga dapat diakses secara daring dan dapat juga diunduh dalam bentuk pdf. ', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
(171, 171, 'G1A015047', '198101122005011002', 'Sistem Informasi Inventaris Barang Lab. Pembelajaran', '', 'VI/2018-2019', 'sistem informasi inventaris laboratorium merupakan sebuah sistem informasi yang mengolah data persediaan barang berbasis web. tujuan dibuatnya sistem ini adalah untuk memudahkan staff dari Program Studi Pendidikan Non Formal Fakultas KIP Universitas Bengkulu dalam memonitoring persedian barang dan melakukan pencarian data barang.', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
(172, 172, 'G1A015055', '198101122005011002', 'SISTEM INFORMASI MANAJEMEN SKRIPSI PROGRAM STUDI PENDIDIKAN NONFORMAL', '', 'VI/2018-2019', 'Sistem ini dibuat untuk memanajemen mahasiswa Pendidikan Non Formal Fakultas KIP Universitas Bengkulu dalam menyelesaikan skripsinya. Sistem ini nantinya akan memberikan keluaran mulai dari pengesahan judul skripsi hingga pemberian nilai akhir. Pada sistem ini setiap mahasiswa yang nantinya akan mendaftar skripsi dapat melanjutkan judulnya yang telah disetujui. Kemudian barulah berlanjut ke tahap selanjutnya dengan diberikannya dosen pembimbing. Selain itu mahasiswa juga dapat mendaftar seminar dan sekaligus melihat kapan jadwal seminar. Sistem ini juga berguna untuk dosen dalam memberikan nilainya kepada mahasiswa yang bersangkutan.', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
(173, 173, 'G1A015067', '198112222008011011', 'Sistem Informasi Alumni Prodi Pendidikan NonFormal Universitas Bengkulu', '', 'VI/2018-2019', 'Sistem Informasi ini dirancang untuk pendataan Alumni dari Prodi Pendidikan Non Formal Universitas Bengkulu, yaitu berupa penstatistikan, profil dan data alumni, dimana pendataan selama ini dilakukan secara manual yang membuat operator kesulitan mencari data dari alumni Prodi Pendidikan Non Formal Univeristas Bengkulu.', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
(174, 174, 'G1A015072', '195904241986021002', 'Sistem Administrasi Perpustakaan ', '', 'VI/2018-2019', 'Sistem Administrasi Perpustakaan ', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
(175, 175, 'G1A015081', '199010182020122012', 'Sistem Informasi Alumni ', '', 'VI/2018-2019', 'Sistem Informasi Alumni ini dibuat untuk mengelola data Alumni SMAN 6 Kota Bengkulu supaya terarsip secara digital. Dimana di SMAN 6 Kota Bengkulu pendataan alumni masih manual sehingga kemungkinan hilang yang akan memperlambat pencarian data alumni. oleh karena itu Sistem Alumni ini dibuat untuk menghasilkan Informasi yang cepat dan akurat.', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
(176, 176, 'G1A016001', '198112222008011011', 'SISTEM INFORMASI MANAJEMEN PEMBAYARAN SPP dI SMAN 1 BENGKULU TENGAH BERBASIS WEB', '', 'VI/2018-2019', 'Ssistem Informais Manajemen Pembayaran SPP adalah sistem informasi yang dirancang untuk memudahkan pihak Tata Usaha dalam melakukan pendataan siswa dan memanajemen pembayaran SPP siswa secara online.', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
(177, 177, 'G1A016003', '198310302009031002', 'SISTEM INFORMASI PEMBUATAN KARTU UJIAN SEKOLAH ', '', 'VI/2018-2019', 'sistem informasi pembuatan kartu ujian sekolah ini dirancang untuk melakukan pembuatan kartu peserta ujian s=di SMA Negeri 6 Bengkulu. yang mana, pihak tata usaha dan bendahara saling berkoordinasi. untuk dapat mencetak kartu ujian, dilakukan oleh pihak bendahara melalui halaman admin, yang mana admin sendiri dari pihak bendahara, agar pihak tata usaha dapat melakukan pencetakan kartu ujian siswa pada halaman tata usaha.', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
