(179, 179, 'G1A016018', '198310302009031002', 'Sistem Informasi Perpustakaan', '', 'VI/2018-2019', 'Sistem Informasi Perpustakaan adalah sistem informasi yang dirancang untuk menangani pengelolaan data buku meliputi transaksi peminjaman buku, transaksi pengembalian buku, denda buku, laporan data pengembalian atau peminjaman buku, laporan pengunjung perpustakaan, katalog buku. Sistem Informasi perpustakaan diharapkan dapata membantu proses pengelolaan perpustakaan di SMA N 8 Kota Bengkulu.', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
