(181, 181, 'G1A016024', '199201312019031010', 'SI PENGELOLAAN DATA SISWA SD NEGERI 66 KOTA BENGKULU', '', 'VI/2018-2019', 'sistem informasi pengelolaan data siswa baru merupakan sistem informasi yang dikembangkan untuk membantu meringankan kinerja staff dalam pendataan siswa baru yang ada di sekolah dasar negeri 66 kota bengkulu.', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
