(187, 187, 'G1A016066', '199010182020122012', 'SISTEM ANJUNGAN INFORMASI MANDIRI WISATA DINAS PARIWISATA PROVINSI BENGKULU', '', 'VI/2018-2019', 'Sistem Informasi Anjunghan Mandiri Wisata adalah sistem informasi yang dirancang dalam bentuk aplikasi android yang akan digunakan pada anjungan informasi KiosK yang akan diterapkan di Bandara Fatmawati Bengkulu oleh Dinas Pariwisata Provinsi Bengkulu sebagai solusi untuk mempromosikan pariwisata di Provinsi Bengkulu. Dengan berbagai fitur  menarik yang lebih fashionable dalam mempromosikan wisata, tidak hanya itu dalam aplikasi ini juga terdapat data perhotelan dan kuliner di lokasi wisata.', '2019-02-17', '2019-06-20', '2019-02-10', 'Selesai', 'Mengulang'),
