(259, 259, 'G1A016053', '197812072005012001', 'SISTEM INFORMASI ALUMNI PROGRAM STUDI ILMU KOMUNIKASI FAKULTAS ILMU SOSIAL DAN ILMU POLITIK UNIVERSITAS BENGKULU', '', 'VI/2020-2021', 'Sistem Informasi alumni merupakan sistem informasi untuk memudahkan mahasiswa aktif dalam mencari alumni di prodinya sehingga dapat membantu mahasiswa dalam membuat tugas akgir, tentang pekerjaan dan dapat mempermudah informasi alumni sehingga tidak perlu lagi pergi ke jurusan untuk mencari informasi.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(260, 260, 'G1A017013', '198909032015041004', 'SISTEM INFORMASI PEMERIKSAAN RAPID TEST COVID-19 KLINIK PRATAMA IQRA\' MEDICAL CENTRE KOTA BENGKULU', '', 'VI/2020-2021', 'Sitem Informasi Rekam Medis berbasi Web di Klinik Pratam Iqra\' Medical Centre Kota Bengkulu merupakan sistem informasi untuk menunjang tercapainya tertib administrasi dalam rangka upaya peningkatan pelayanan kesehatan di Klinik Pratama Iqra\' Medical Centre Kota Bengkulu. Baik dokter maupun tenaga kesehatan lainnya dapat melakukan pembukuan pasien. Pada sistem ini akan terdapat fitur seperti manajemen pasien, manajmen dokter, manajemen kunjungan pasien , serta manajemen jadwal dokter.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(261, 261, 'G1A017023', '198909032015041004', 'Sistem Informasi Perpustakaan Berbasis Web SMA N 6 Kota Bengkulu', '', 'VI/2020-2021', 'Sistem Informasi Perpustakaan Berbasis Web SMA N 6 Kota Bengkulu', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(262, 262, 'G1A017048', '199010182020122012', 'Sistem Informasi Penggajian CV Tobo Kito Mandiri', '', 'VI/2020-2021', 'Sistem Informasi Penggajian merupakan sistem informasi yang dibuat untuk manajemen data penggajian karyawan yang bekerja di CV. Tobo Kito Mandiri. Sistem ini dapat melakukan manajemen perhitungan gaji, laporan data penggajian, penyimpanan data, dan penggajian data karyawan.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Mengulang'),
(263, 263, 'G1A018002', '197812072005012001', 'Sistem Informasi Absensi Praktikum Informatika Berbasis Web dan Android Menggunakan QRcode ', '', 'VI/2020-2021', 'Sistem Informasi Absensi Praktikum Informatika Berbasis Web dan Android Menggunakan QRcode ini adalah sistem informasi yang bertujuan untuk meminimalisir kesalahan pencatatan dan menghasilkan data yang benar-benar akurat sehingga mengurangi kemungkinan kecurangan yang dilakukan oleh mahasiswa dan memudahkan asdos dalam melakukan absensi, karena menggunakan sistem QR. Pada sistem ini terdapat 3 aktor yaitu admin, asods, dan mahasiswa. Untuk admin dan asdos itu menggunakan web dan mahasiswa menggunakan android dalam menjalankan sistemnya.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(264, 264, 'G1A018005', '199201042019031015', 'SISTEM INFORMASI PENDATAAN PERKEMBANGAN ANAK BERBASIS WEBSITE PADA RUMAH SINGGAH AL-MA’UN KOTA BENGKULU', '', 'VI/2020-2021', 'Sistem ini berfungsi untuk mendata perkembangan anak-anak yang berada di bawah naungan rumah singgah Al-Ma\'un. Data tersebut diharapkan dapat membantu para pengajar ataupun pengurus rumah singgah dalam mengambil keputusan untuk anak-anak kedepannya.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru');
INSERT INTO `tb_kerjapraktik` (`id_kp`, `id_lks`, `npm`, `nip`, `judul`, `nama_pl`, `semester_ta`, `uraian`, `jangka_waktu_s`, `jangka_waktu_e`, `tgl_pengajuan`, `status`, `keterangan`) VALUES
(265, 265, 'G1A018007', '199007092019032025', 'SISTEM INFORMASI TES EDWAR PERSONAL PREFERENCE SCHEDULE  DI CV. PSIKO (SAHABAT PSIKOLOGI)  UNTUK MENENTUKAN KEPRIBADIAN  SEORANG INDIVIDU', '', 'VI/2020-2021', 'Sistem Informasi Tes EPPS untuk menetukan karakteristik seorang individu merupakan system informasi yang dapat melakukan tes EPPS bebrbasis web dan dapat mengeluarkan hasil berupa deskripsi individu berdasarkan soal yang telah di jawab. Tujuan dari system informasi ini adalah pertama, memberi kemudahan admin dalam memeriksa hasil tes dan menentukan hasil tes dengan cepat. Kedua, peserta ujian tidak perlu lama menunggu hasil tes. Adapun pengguna system ini nantinya terdiri dari 3 aktor yaitu admin, peserta ujian dan direktur sahabat psikologi. Untuk admin mengelola data peserta, mengelolah data jadwal dan mengelolah soal serta mampu mengelolah hasil tes. Untuk peserta ujian dapat melakukan input data, perubahan data, melaksanaka tes dan melihat hasil tes. Hasil tes tersebut dapat di cetak dan diberikana oleh admin dengan persetujuan pihak kantor Sahabat Psikologi.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(266, 266, 'G1A018009', '199010182020122012', 'Sistem Informasi Inventaris Barang Penanggulangan Bencana Daerah Provinsi Bengkulu', '', 'VI/2020-2021', 'Sistem Informasi Inventaris Barang Penanggulangan Bencana Daerah Provinsi Bengkulu', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(267, 267, 'G1A018011', '199201312019031010', 'Rancang Bangun Sistem Informasi Manajemen Kelas SD Negeri 17 Kota Bengkulu Berbasis Website”.', '', 'VI/2020-2021', 'Perancangan Sistem Informasi Akademik Berbasis Web merupakan perancangan sistem informasi untuk memudahkan dalam melakukan proses pendataan akademik. Sistem informasi akademik ini juga guna untuk mempermudah dalam memberikan informasi yang akurat dan tepat saat dibutuhkan. Sistem informasi akademik nantinya berisiskan pengelolaan data siswa, guru, asset, program kesiswaan dan laporan rekap jurnal guru. ', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
