(272, 272, 'G1A018018', '198112222008011011', 'SISTEM INFORMASI KEBENCANAAN WILAYAH BENGKULU', '', 'VI/2020-2021', 'Sistem Informasi Kebencanaan Wilayah Bengkulu ini merupakan sistem informasi berbasis wen yang dirancang untuk mempermudah BPBD Provinsi Bengkulu untuk menginformasikan kepada masyarakat luas, agar masyarakat tau lokasi bencana dan bencana apa yang terjadi. Di dalam website ini masyarakat juga mendapatakan informasi kebencanaan mulai dari pra bencana, informasi peta rawan bencana, kondisi saat bencan dan penanggulangan paska bencana. bentuknya dalam bentuk website yang terakses ke media sosial sehingga mudah di akses oleh masyarakat.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(273, 273, 'G1A018019', '198101122005011002', 'SISTEM INFORMASI PENERIMAAN PESERTA DIDIK BARU (PPDB) SD NEGERI 17  KOTA BENGKULU ', '', 'VI/2020-2021', 'Sistem Informasi Pendaftaran Peserta Didik Baru ini adalah sistem informasi yang mengelola data tentang siswa yang akan mendaftar di SDN 17 Kota Bengkulu berbasis web. Tujuan dengan adanya sistem informasi Pendaftaran Peserta Didik Baru ini yaitu untuk mendata siswa yang akan mendaftar di dalam SDN 17 Kota Bengkulu apakah sudah sesuai dengan persyaratan yang ada apa belum. Kemudian dengan adanya sistem yang terkomputerisasi ini akan membantu staff agar dapat meningkatkan mutu pelayanan.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(274, 274, 'G1A018021', '198906232018031001', 'SISTEM PENDUKUNG KEPUTUSAN MENENTUKAN SISWA BERPRESTASI MENGGUNAKAN METODE SIMPLE ADDITIVE WEIGHTING PADA SMP NEGERI 11 KOTA BENGKULU', '', 'VI/2020-2021', 'SISTEM PENDUKUNG KEPUTUSAN MENENTUKAN SISWA BERPRESTASI MENGGUNAKAN METODE SIMPLE ADDITIVE WEIGHTING PADA SMP NEGERI 11 KOTA BENGKULU', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(275, 275, 'G1A018023', '198502042008122002', 'SISTEM INFORMASI PANGKALAN DATA KERJA SAMA DAN LAYANAN UPT KERJA SAMA DAN LAYANAN INTERNASIONAL UNIVERSITAS BENGKULU', '', 'VI/2020-2021', 'Pada kerja praktik ini, akan memperbaharui sistem informasi yang telah ada dan digunakan oleh UPT KSLI sebelumnya, dengan menambahkan beberapa fitur dan fungsi yang bertujuan dalam memudahkan admin maupun mahasiswa dalam menggunakan sistem ini.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(276, 276, 'G1A018025', '198411292008122000', 'Sistem Informasi Berbasis Web untuk Manajemen Surat Tugas dan Surat Keterangan Penelitian dan Pengabdian LPPM Universitas Bengkulu', '', 'VI/2020-2021', 'Sistem Informasi Berbasis Web untuk Manajemen Surat Tugas dan Surat Keterangan Penelitian dan Pengabdian LPPM Universitas Bengkulu merupakan sistem yang dirancang untuk mempermudah pendataan dan pembuatan surat tugas dan surat keterangan penelitian dan pengabdian yang ada di LPPM Universitas Bengkulu.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(277, 277, 'G1A018026', '198906232018031001', 'SISTEM INFORMASI PENILAIAN KINERJA KARYAWAN BANK PERKREDITAN RAKYAT MAROBA ITE', '', 'VI/2020-2021', 'Sistem informasi ini merupakan sistem informasi untuk memudahkan pimpinan cabang dalam membuat penilaian kinerja karyawan untuk memutuskan hadiah dan hukuman dalam periode semester. sistem ini akan memiliki 3 tingkatan pengguna utama dimana hak tertinggi akan dimiliki oleh pimpinan cabang, lalu ada staff yang dapat mengisi penilaian cabang, lalu ada staff yang akan memberikan penilaian untuk masing-masing anggota staffnya, dan penilaian ini akan sampai ke pimpinan cabang, dalam sistem ini kepala staff dapat memberikan penilaian untuk staff tim mereka, dan kepala cabang dapat melihat penilaian masing-masing staff untuk diri sendiri dan penilaian staff yang diberikan oleh kepala staff.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(278, 278, 'G1A018027', '198411292008122000', 'SISTEM INFORMASI TES CULTURE FAIR INTELLIGENCE TEST DAN TES ROTHWELL MILLER INTEREST BLANK DI CV PSIKO (SAHABAT PSIKOLOGI)', '', 'VI/2020-2021', 'SISTEM INFORMASI TES CULTURE FAIR INTELLIGENCE TEST DAN TES ROTHWELL MILLER INTEREST BLANK DI CV PSIKO (SAHABAT PSIKOLOGI)', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(279, 279, 'G1A018028', '198909032015041004', 'APLIKASI TRANSAKSI HEWAN QURBAN BERBASIS ANDROID DI KANTOR PERWAKILAN BANK INDONEISA PROVINSI BENGKULU', '', 'VI/2020-2021', 'Aplikasi Transaksi Qurban Bank Indonesia Bengkulu merupakan aplikasi qurban secara mobile atau android dalam upaya peningkatan efisiensi dalam transaksi qurban di kantor perwakilan Bank Indonesia Bengkulu.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(280, 280, 'G1A018034', '199007092019032025', 'SISTEM INFORMASI UJIAN ONLINE BERBASIS WEB  DI SMP NEGERI 1 KOTA BENGKULU', '', 'VI/2020-2021', 'Ssitem Informasi Ujian Online SMP N 1 Kota Bengkulu dirancang dengan tujuan untuk menyediakan media ujian berbasis komputer sehingga bisa mengurangi penggunaan kertas ketika masa ujian berlangsung dan mempermudah ujian pada masa pandemi sekarang. Sistem ini juga memberikan kemudahan kepada guru dalam mengkoreksi soal-soal yang  dikerjakan siswa  dan merekap nilai ujian siswa.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
(281, 281, 'G1A018044', '198411292008122000', 'Sistem Informasi Ketercapaian Luaran Penelitian LPPM Universitas Bengkulu', '', 'VI/2020-2021', 'Sistem Informasi Data Luaran Penelitian Lembaga Penelitian dan Pengabdian Masyarakat di Universita Bengkulu merupakan sistem untuk mempermudah staff dalam merekap data luaran penelitian di LPPM UNIB dan mempermudah dosen dalam mendata luaran penelitian atau memperbaharui data luaran penelitian.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
