(283, 283, 'G1A018049', '198502042008122002', 'Sistem Pengajuan Judul Skripsi Program Studi Sistem Informasi FT UNIB', '', 'VI/2020-2021', 'Sistem Pengajuan Judul Skripsi Program Studi Sistem Informasi FT UNIB. Dalam Sistem ini, mahasiswa dapat melakukan pengajuan judul skripsi dan menerima konfirmasi apakah judul skripsi yang diajukan diterma atau tidak, mahasiswa juga mendapatakan pemberitahuan bahwa proposal nya terdapat revisi dari dosen atau tidak. Dan jika proposal yang diajukan sudah di ACC maka mahasiswa akan mendapatkan pembimbing 1 dan 2 serta dosen penguji 1 dan 2', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
