(293, 293, 'G1A018066', '198909032015041004', 'Sistem Informasi dan Permohonan Sidang Nikah Dinas Bagi Anggota Polri & PNS di Polda Bengkulu', '', 'VI/2020-2021', 'Sistem Informasi dan Permohonan Sidang Nikah Dinas Bagi Anggota Polri & PNS di Polda Bengkulu ini dirancang untuk mengkatkan layanan yang ada di Polda Bengkulu. Dimana saat ini untuk pengurusan berkas dan penjadwalan nikah dinas polisi masih dilakukan secara manual dengan mengumpulkan berkas syarat secara fisik dan diolah oleh admin.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
