(295, 295, 'G1A018073', '199411232020122000', 'Sistem Informasi Stock Opname Barang Habis Pakai Laboratorium Komputer Poltekkes Kemenkes Bengkulu', '', 'VI/2020-2021', 'Sistem Informasi Stock Opname adlah sistem informasi inventaris berbasis website yang dirancang untuk mempermudah pendataan barang habis pakai. Dalam sistem ini terdapat pilihan untuk melakukan tambah, edit, dan hapus data barang. Sistem ini juga menggunakan QR Code yang berfungsi untuk menampilkan informasi seputar rekap barang habis pakai yang berada di Laboratorium Komputer Poltekes Kemenkes Bengkulu.', '2021-02-17', '2021-06-20', '2021-02-10', 'Selesai', 'Baru'),
